import React, { useState, useEffect } from "react";
import axios from "axios";
import Demot from "./Demot"



function App() {
  const [demots, setDemots] = useState([])
  const refreshList = () => {
      axios.get('/api/')
      .then(function (response) {
        setDemots(response.data) 
      })
    };

    useEffect(() => {
      refreshList()
    }, [])


    console.log(demots)


    return (<div>
    {demots.map(demot =>(
    <Demot
    key= {demot.id} 
    title={demot.title}
    subtitle={demot.subtitle}  
    image={demot.image}
    />
    ))}</div>)

  }

export default App;
